export function Chart(setSymbols:any){
    let cnv:any = useRef(null);
    useEffect(()=>{
        let ctx = cnv.current.getContext('2d');
        ctx.beginPath();
        ctx.moveTo(0.5,0.5);
        ctx.lineTo(10.5,20.5);
        ctx.lineTo(20.5,0.5);
        ctx.stroke();
        // ctx.rect(40,40,200,200);
        // ctx.fillStyle = 'blue';
        // ctx.fill();
    },[]);
    return (
        <div></div>
    );   
}
